Podcasts by myTuner provides you with the ultimate mobile experience when listening to Podcasts! You can easily find the best podcasts based on its tailored algorithm, presented in a modern, beautiful and easy to use interface. 

No matter if you are a recent podcast user or a podcast addict that uses all the advanced features, you will have all that you need in just one podcast player app. With a huge variety of podcast categories, top podcasts by country, trending episodes or episodes by language (among many other options to choose from), you will be able to stream or download your favorite podcast episodes for free, anywhere and anytime!

FEATURES

Discoverability

- Listen to over 20 million podcast episodes;
- Subscribe podcasts by country, language or category;
- Discover podcast channels from 16 different categories, including sports, comedy, technology and news;
- Find the most popular podcasts and episodes in more than 200 countries / territories;
- Listen to your favorite podcasts in 50 different languages;
- Search by podcast title, episode title, author's name or top searches;

Personalisation

- Optional notifications for new episodes of subscribed podcasts;
- Personalize the home tab with subscribed podcasts, top podcasts/episodes and favorite categories;
- Manage your list of episodes in progress, new episodes, downloaded episodes and subscribed podcasts;
- Automatic download of episodes and auto delete of played episodes;
- Manage mobile data for playing and downloading episodes;

Playing features

- Download podcasts to listen to offline or stream them immediately;
- Voice boost to make shows easier to listen to;
- Adjustable playback speed;
- Set the duration of the skip buttons (forward and back);
- Sort the order of episodes (from oldest to newest or from newest to oldest);

Other features

- Sleep timer with advanced options such as gradual volume decrease; 
- Alarm clock;
- Easily share your favorite podcast shows and podcast episodes;
- Supports CarPlay, AirPlay and Chromecast;


Podcasts by myTuner features many different categories for you to explore, from education to comedy, news and sports and many others! It features an always up to date database, so you can discover and enjoy the right podcasts for you!

